import React from "react";

function HouseholdHazardousWaste() {
  return (
    <div style={{ padding: 20 }}>
      <h1>Household Hazardous Waste</h1>
      <p>Include chemicals, paints, and cleaning products. Dispose at certified collection sites.</p>
    </div>
  );
}

export default HouseholdHazardousWaste;
